import React, { Component } from 'react';
import SignIn from "./MainComponents/SignIn"


import { Switch, Route, Redirect, withRouter } from 'react-router-dom'

class ItsPoppinWrapper extends Component {

  state ={
    userID:null,
    username:null,
    jwt:null
  }

  signedIn = (user)

  render(){
    return(
      <div>
        <Switch>
          <Route exact path="/" render={props => <Redirect to="/signin"/>}/>
          <Route exact path="/signin" render={props => <SignIn/>}/>
        </Switch>
      </div>
    )
  }

}


export default withRouter(ItsPoppinWrapper)
